        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { 
            font-family: 'Arial', sans-serif; 
            font-size: 16px; 
            line-height: 1.6;
            padding: 20px;
            max-width: 900px;
        }

        /* Typography */
        h1 { font-size: 32px; margin-bottom: 16px; font-weight: bold; }
        h2 { font-size: 24px; margin-bottom: 12px; margin-top: 32px; font-weight: bold; }
        h3 { font-size: 20px; margin-bottom: 12px; margin-top: 24px; font-weight: bold; }

        p { margin-bottom: 16px; }

        /* Lists */
        ul, ol { margin-bottom: 16px; padding-left: 24px; }
        li { margin-bottom: 6px; }
        ul ul, ol ul { margin-top: 6px; margin-bottom: 0; }

        /* Code */
        code {
            font-family: 'Courier New', monospace;
            font-size: 14px;
            background-color: #f3f4f6;
            padding: 2px 4px;
            border-radius: 3px;
        }

        pre {
            background-color: #f6f8fa;
            border: 1px solid #d1d9e0;
            border-radius: 6px;
            padding: 16px;
            margin: 16px 0;
            overflow-x: auto;
            font-family: 'Courier New', monospace;
            font-size: 14px;
            line-height: 1.4;
        }

        /* Tables */
        table {
            border-collapse: collapse;
            width: 100%;
            margin: 16px 0;
        }

        th, td {
            border: 1px solid #d1d9e0;
            padding: 8px 12px;
            text-align: left;
        }

        th {
            background-color: #f6f8fa;
            font-weight: bold;
        }

        /* Quotes */
        blockquote {
            margin: 16px 0;
            padding: 16px 20px;
            border-left: 4px solid #fbbf24;
            background-color: #fef3c7;
            color: #92400e;
        }

        .warning {
            border-left-color: #ef4444;
            background-color: #fee2e2;
            color: #991b1b;
        }

        /* Emphasis */
        .emphasis { font-style: italic; }
        .strong { font-weight: bold; }



    API Documentation
    This document demonstrates a typical technical documentation layout with multiple content types.

    Function Reference

    calculateSum(a, b)
    Calculates the sum of two numbers with validation.

    Parameters



                Name
                Type
                Description




                a
                number
                First operand


                b
                number
                Second operand




    Example Usage
    const result = calculateSum(5, 3);
console.log(result); // Output: 8

// Error handling
try {
    calculateSum("invalid", 5);
} catch (error) {
    console.error(error.message);
}


        Warning: This function throws an error if non-numeric values are provided.


    Return Value

        Type: number
        Description: The sum of the two input parameters
        Range: Any valid JavaScript number

                Supports both integers and floating-point numbers
                Handles negative numbers correctly






